import React from 'react'
import { Card } from 'react-bootstrap'

const Product = ({_id, image}) => {
    return (
        <Card className="my-3 p-3 rounded">
            <a href={`/product/${_id}`}>
                <Card.Img src={image} variant='top'/>
            </a>
        </Card>
    )
}

export default Product
